import { Card, Input, TabsProps, Form, Button, Tabs } from "antd";

const Login = () => {
  const signin = () => {};
  const onChange = (key: string) => {
    console.log(key);
  };
  const items: TabsProps["items"] = [
    {
      key: "1",
      label: `Login`,
      children: (
        <div>
          <Form layout="vertical" onFinish={signin}>
            <Form.Item name="username" label="URL">
              <Input placeholder="username" />
            </Form.Item>
            <Form.Item name="password" label="URL">
              <Input placeholder="password" />
            </Form.Item>
            <Button htmlType="submit">Login</Button>
            <Button>Back</Button>
          </Form>
        </div>
      ),
    },
    {
      key: "2",
      label: `Sign up`,
      children: <div></div>,
    },
  ];
  return (
    <div className="bg-[#F9ECCE] w-[100%] h-[100vh] ">
      <div className="px-[50vh]  !content-center">
      <Tabs defaultActiveKey="1" items={items} onChange={onChange} />
      </div>
    </div>
  );
};
export default Login;
